import { shallowEqual, useDispatch, useSelector } from 'react-redux';

import { selectNavBarList } from '../../features/navBarList/navBarSlice'
import NavBarItem from '../navBarItem/NavBarItem'

import '../navBarList/navBarListStyle.css'

const NavBarList = () => {
  //const navBarList = useSelector(selectNavBarList)
  const navBarList = useSelector(state => {
    console.log('----- state is being returned -----: '+state.navBarList)
    return state.navBarList
  })
  
  useEffect(() => {
    console.log('useEffect - navBarList state: '+navBarList)
  },[navBarList])

  console.log('NavBarList - state: '+navBarList)
  
  return (
    <div className='navBarList scroll'>
      {navBarList?.map(navItem => (     
        <div key={navItem.navItemKey}>
          <NavBarItem navItem={navItem}></NavBarItem>
        </div>           
      ))}
    </div>
  )
}

